  false,\n\t\"url\": null,\n\t\"notes\": \"Summary of grazing research in the San
  Luis Valley, specifically at Alamosa National Wildlife Refuge and Monte Vista National
  Wildlife Refuge.  The control of tall whitetop is the initial focus of the study.
  \ Two strategies of control are examined: grazing and herbicide.  This research
  will determine whether grazing or herbicide is the appropriate strategy of weed
  control to meet refuge goals.  General, research, and management strategies and
  experimental design for tall whitetop control are included in this summary of the
  research to be conducted.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
